def count_nucleotide_frequency(seq):
    temp_freq_dict = {"A": 0, "C": 0, "G": 0, "T": 0}
    for nucleotide in seq:
        temp_freq_dict[nucleotide] += 1
    return temp_freq_dict

# Sample dataset
dna_seq = ""


result = count_nucleotide_frequency(dna_seq)
result = " ".join([str(val) for key, val in result.items()])

print(result)